import React from 'react';

function App() {
  return (
    <div className="App">
      <div className="container-fluid" style={{height:'100%'}}>
        <div className="row" style={{height:'100%'}}>
          <div className="col-sm-3 bg-dark" style={{height:'100%'}}>
            left
          </div>
          <div className="col-sm-9 bg-light" style={{height:'100%'}}>
            right
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
